#!/usr/bin/env bash

update_system() {
    sudo apt update; sudo apt upgrade
}

install_prerequisites() {
    sudo apt install linux-headers-$(uname -r) build-essential dkms
}

# Função para remover drivers antigos
remove_old_drivers() {
    sudo apt purge bcmwl-kernel-source
}

# Baixar e instalar o firmware Broadcom
install_broadcom_firmware() {
    wget http://www.lwfinger.com/b43-firmware/broadcom-wl-5.100.138.tar.bz2
    wget http://downloads.openwrt.org/sources/broadcom-wl-5.10.56.27.3_mipsel.tar.bz2
    tar -xf broadcom-wl-5.100.138.tar.bz2
    tar -xf broadcom-wl-5.10.56.27.3_mipsel.tar.bz2
    sudo b43-fwcutter -w /lib/firmware broadcom-wl-5.100.138/linux/wl_apsta.o
}

load_b43_driver() {
    sudo modprobe b43
}

check_driver_status() {
    dmesg | grep b43
}

main() {
    update_system
    install_prerequisites
    remove_old_drivers
    install_broadcom_firmware
    load_b43_driver
    check_driver_status
}

main

% Solicitar al usuario que ingrese una lista de valores de K separados por comas
K_values = input('Ingrese una lista de valores de K, separados por comas, por ejemplo 0.1, 0.5, 1, 2, 5, 10: ', 's');
%K_values = [0.1, 0.5, 1, 2, 5, 10];

% Verificar si los valores ingresados son válidos
if isempty(K_values)
    error('Lista de valores de K no válida. Ingrese valores numéricos separados por comas.');
end

% Inicializar vectores para almacenar los parámetros de la respuesta
Kp_values = zeros(1, length(K_values));
tr_values = zeros(1, length(K_values));
tp_values = zeros(1, length(K_values));
OS_values = zeros(1, length(K_values));
ts_values = zeros(1, length(K_values));

% Inicializar vectores para almacenar los errores en estado estacionario
error_step_values = zeros(1, length(K_values));
error_ramp_values = zeros(1, length(K_values));
error_parabola_values = zeros(1, length(K_values));

% Inicializar una variable para la copia de los gráficos
copy_figure = 0;

% Bucle para cada valor de K
for i = 1:length(K_values)
    Kc = K_values(i);  % Establecer el valor de Kc
    
    % Definir las ecuaciones del sistema de control
    Gc = Kc;  % Controlador
    Gp = tf([1], [1, 3, 2]);  % Planta (ajusta los coeficientes según tu planta)
    Ka = 1;  % Actuador (suponiendo un actuador ideal)
    Gs = 1;  % Sensor (suponiendo un sensor ideal)

    % Simulación del sistema de control
    sys = feedback(Ka * Gc * Gp, Gs);
    [y_step, t] = step(sys, time_span);

    % Calcular los parámetros de la respuesta transitoria
    Kp_values(i) = max(y_step);  % Constante de proporcionalidad
    tr_values(i) = compute_rise_time(t, y_step);  % Tiempo de subida
    tp_values(i) = t(find(y_step == max(y_step), 1));  % Tiempo pico
    OS_values(i) = max(y_step) - 1;  % Sobreelongación
    ts_values(i) = compute_settling_time(t, y_step);  % Tiempo de establecimiento

    % Calcular el error en estado estacionario para diferentes entradas
    error_step_values(i) = compute_steady_state_error(step_input, t, y_step);  % Error para entrada escalón
    error_ramp_values(i) = compute_steady_state_error(ramp_input, t, y_ramp);  % Error para entrada rampa
    error_parabola_values(i) = compute_steady_state_error(parabola_input, t, y_parabola);  % Error para entrada parábola
end

% Graficar los resultados
figure;

subplot(2, 1, 1); % Gráficos de parámetros de respuesta
plot(K_values, Kp_values, 'r', 'LineWidth', 2);
hold on;
plot(K_values, tr_values, 'g', 'LineWidth', 2);
plot(K_values, tp_values, 'b', 'LineWidth', 2);
plot(K_values, OS_values, 'm', 'LineWidth', 2);
plot(K_values, ts_values, 'c', 'LineWidth', 2);
legend('Kp', 'tr', 'tp', 'OS', 'ts');
xlabel('Valor de Kc');
title('Parámetros de Respuesta vs. Valor de Kc');

subplot(2, 1, 2); % Gráficos de errores en estado estacionario
plot(K_values, error_step_values, 'r', 'LineWidth', 2);
hold on;
plot(K_values, error_ramp_values, 'g', 'LineWidth', 2);
plot(K_values, error_parabola_values, 'b', 'LineWidth', 2);
legend('Error Escalón', 'Error Rampa', 'Error Parábola');
xlabel('Valor de Kc');
title('Errores en Estado Estacionario vs. Valor de Kc');

% Pregunta al usuario si desea copiar los gráficos en una imagen
copy_figure = input('¿Desea copiar los gráficos en una imagen? (0: No, 1: Sí): ');

% Funciones para calcular el tiempo de subida y el error en estado estacionario
function tr = compute_rise_time(t, y)
    % Calcular tiempo de subida (tr)
    tr = 0;
    for k = 1:length(y)
        if y(k) >= 0.90 * max(y)
            tr = t(k);
            break;
        end
    end
end

function ts = compute_settling_time(t, y)
    % Calcular tiempo de establecimiento (ts)
    ts = 0;
    for k = length(y):-1:1
        if abs(y(k) - 1) <= 0.02
            ts = t(k);
        else
            break;
        end
    end
end

function error_ss = compute_steady_state_error(input, t, y)
    % Calcular el error en estado estacionario
    steady_state_value = input(end);  % Valor en estado estacionario
    error_ss = abs(steady_state_value - y(end));
end

